values:
Holy crap. I got the retirement list in the mail yesterday from PartyLite. Bastards are retiring a lot of cool stuff! They have to though, to keep new exciting stuff in the catalogs. Time to stock up on my favorite scents. I can't believe they're getting rid of cinnamon tea cakes, it's a brand new scent, and it's so yummy-tastic, I want to EAT the candles. I'm going to make a bunch of copies of the retirement list so I can hand them out.. the list is&nbsp;teeny tiny font, covering the front and back of the page.&nbsp;

Speaking of PartyLite, REMINDER!! Open house, our place, Sunday 2-6. Come check out the retirement list and cry with me. BOO HOO! :)

If you can't make it, I will drive all over town and deliver catalogs/take orders. I wanna be your candle pusher. :) I mean.. candle salesperson.&nbsp;

yeahthat'sit.
